スプリング交換せずに簡単に車高アップ！ハイトアップブロックは車高調整機能を持たないノーマル形状サスペンション用に開発された新発想の車高調整アダプターです。ローダウンスプリングへの交換やスプリングのヘタリが原因で車高が想定以上に低くなってしまった場合に効果的です。 <br><br>またアンダー補強バーや大径マフラーの装着によって地上高不足に陥ったときにも大幅な車高アップが可能です。装着は簡単で、ブロック本体をボディとアッパーマウントの間へ割り込ませるだけで約15mm以上アップします。前後バランスが気になる場合は別売りのハイトアップスペーサーを併用すれば理想の車高バランスを実現できます。<br><br>●保安基準適合品 ●左右1セット ●材質：ジュラルミン <br><br>対応車種：JZX90 マーク2 <br><br>　車検対応品<br><br>足回り/足回りその他<tr><td colspan="2">
