車高ダウンによって狂いが生じたジオメトリーをタイロッドエンドのボールジョイントをオフセットすることにより補正。面倒なセッティングの必要がなく、タイロッドエンドを交換するだけでコーナリング時に発生するトー変化（バンプステア）を抑え、リニアでシャープな旋回性能を実現します。 <br><br>またブレーキング時の挙動安定性も飛躍的に高まり、究極の限界バトルを可能にします。保安基準適合内の車高ダウン（最低地上高9cm）からサーキット走行専用のローダウンに対応。<br><br>●保安基準適合品 ●ダストブーツ標準装備 ●新開発ボールジョイント採用 ●完全ボルトオン設計 ●純正タイロッド用 <br><br>対応車種：BNR32 スカイライン GT-R <br><br>　車検対応品<br><br>足回り/足回りその他<tr><td colspan="2">
